Duck Typing er en metode som bygger på JavaScript og som tar kontakt med TypeScript, denne metode er brukt for att kontrollera var en variabel er tydlighet med.

Detta betyr at en variabel kan ha mer end en typ, men som viss typ, så vi kan behandla den som om den var tydlighet med det.

Som ett exempel kan vi använda ett typ som `Animal` och lägga ut en variabel med denna typ:

```javascript
let animal = new Animal();
```

och få samma effekt som om den var tydlighet med ett typ som `Dog`, för att kunna kontrollera vilken typ den är:

```javascript
if (animal instanceof Dog) {
    console.log("Dog", animal);
} else if (animal instanceof Cat) {
    console.log("Cat", animal);
} else if (animal instanceof Elephant) {
    console.log("Elephant", animal);
} else if (animal instanceof Snake) {
    console.log("Snake", animal);
} else {
    console.log("Error: Animal type not recognized", animal);
}

